function Cadastro(){
    return(
        <div className='telaCadastro'>
            <div className='tituloCadastro'>
                <h1>Crie uma conta</h1>
                <p>Preencha os campos abaixo para criar sua conta.</p>
            </div>

            <div className='inputsCadastro'>
                <input></input>
                <input></input>
                <input></input>
                <input></input>
            </div>

            <button></button>
        </div>
    )
}

export default Cadastro;
